    <!-- 
        图片标签用于向当前页面引入一个外部图片
            使用img标签来引入外部图片，img标签是一个自结束标签
            img 属于替换元素，介于块元素和行内元素之间
            属性:
                src 指定的是外部图片的路径（路径规则和超链接一样），可以是内部也可以是外部
                
                alt 图片的描述，这个描述默认情况下不会显示，有些浏览器会在图片无法夹在时显示
                    搜索引擎会根据alt中的内容来识别图片，如果不写alt属性，则图片不会被搜索引擎所收录

                width 图片的的宽度（单位是像素）
                height 图片的高度
                    宽度和高度如果修改其中一个，则另一个等比例缩放



                一般情况在pc段，不建议修改图片大小


        图片的常见格式
            jpeg（jpg）支持的颜色比较丰富，不支持透明效果，不支持动图
            gif 支持的颜色比较少，支持简单透明，支持动图
            png支持的颜色丰富，支持简单透明，不支持动图（专为网页而生）
            webp谷歌新推出的专门用来表示网页的图片的一种格式，具备其他图片格式的所有优点，而且文件特别小，缺点是兼容性不太好
            base64将图片使用base64编码，这样可以将图片转化为字符，通过字符的形式来引入图片，一般是一些需要和网页一起加载的图片才会使用
            效果一样用小的，效果不一样用效果好的
            


     -->
